/*-- #include "src.cpp/string.h" start --*/

#define lstring_c
#define LUA_CORE

/*-- #include "src.cpp/lua.h" start --*/

/*-- #include "src.cpp/lmem.h" start --*/
/*-- #include "src.cpp/lobject.h" start --*/
